import React from 'react';
import Navigation from '../components/Navigation';

export const Project1 = () => {
    return (
        <main>
            <div className="project">
                <Navigation />
                Project 1
            </div>
        </main>
    )
}

export const Project2 = () => {
    return (
        <main>
            <div className="project">
                <Navigation />
                Project 2
            </div>
        </main>
    )
}
